import React, {Component} from "react";
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Chip from '@material-ui/core/Chip';
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography/Typography";
import SelIcon from '@material-ui/icons/Eject';
import TabIcon from '@material-ui/icons/Apps';
import TrashIcon from '@material-ui/icons/Delete';

console.log("Inside PathComponent.")

const styles = theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing.unit * 2,
        textAlign: 'left',
    },
    paperImage: {
        textAlign: 'center',
        padding: theme.spacing.unit * 2,
    },
    selchip: {
        margin: theme.spacing.unit,
	cursor: "pointer",
        color:"red",
        borderColor:"blue",
    },
    tabchip: {
        margin: theme.spacing.unit,
	cursor: "pointer",
        color:"green",
        borderColor:"blue",
    },
    othchip: {
        margin: theme.spacing.unit,
	cursor: "pointer",
        color:"blue",
        borderColor:"blue",
  },
});

function onCellClick(event) {
    var rowid=event.target.getAttribute("rowid");
    event.target.innerHTML = rowid;
}

function SelectChip(props) {
    const { classes, state } = props;
    return <Chip
           icon={<SelIcon />}
           label="Select Chip"
           onClick={handleClick}
           className={classes.selchip}
           variant="outlined"
	/>
}

function TableChip(props) {
    const { classes, state } = props;
    return <Chip
           icon={<TabIcon />}
           label="Table Chip"
           onClick={handleClick}
           className={classes.tabchip}
           variant="outlined"
	/>
}

function OtherChip(props) {
    const { classes, state } = props;
    return <Chip
           label="Other Chip"
           onClick={handleClick}
           className={classes.othchip}
           variant="outlined"
	/>
}


function Details(props) {
//  items=[{value:"X",index:1}]
//  {keys.map((value, index) => (<SelectChip key={`item-${index}`} index={index} value={value} />))}
    const { classes, state } = props;
    return <div style={{width: '100%'}}>
	   <SelectChip classes={classes} state={state}/>
	   <TableChip  classes={classes} state={state}/>
	   <TableChip  classes={classes} state={state}/>
	   <OtherChip  classes={classes} state={state}/>
	   <OtherChip  classes={classes} state={state}/>
	   <OtherChip  classes={classes} state={state}/>
	   <OtherChip  classes={classes} state={state}/>
	   <OtherChip  classes={classes} state={state}/>
        </div>
}

function handleDelete() {
  alert('You clicked the delete icon.'); // eslint-disable-line no-alert
}

function handleClick() {
  alert('You clicked the Chip.'); // eslint-disable-line no-alert
}

class PathComponent extends Component {
    state = {};
    render() {
        const { classes, state } = this.props;
        return (
            <div className={classes.root}>
                <Grid container spacing={15}>
                    <Grid item xs={12}>
		       <Details classes={classes} state={state}/>
                    </Grid>
                </Grid>
            </div>
        );
    }
}

PathComponent.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(PathComponent);



